function getMonths(){return[{name:"January",id:1},{name:"February",id:2},{name:"March",id:3},{name:"April",id:4},{name:"May",id:5},{name:"June",id:6},{name:"July",id:7},{name:"August",id:8},{name:"September",id:9},{name:"October",id:10},{name:"November",id:11},{name:"December",id:12}]}function getYears(){var e=getCurrentYear();return[e-2,e-1,e]}function getCurrentYear(){var e=new Date,t=e.getFullYear();return t}function getCurrentMonth(){var e=new Date;return e.getMonth()+1}var AnalyticsModule=angular.module("AnalyticsModule",[]);AnalyticsModule.controller(Monthly);var Monthly=["$scope","$http",function(e,t){e.setDates=function(){e.Months=getMonths();e.Years=getYears();e.selectedMonth=getCurrentMonth();e.selectedYear=getCurrentYear()};e.getMonthData=function(){var n=e.selectedYear+"-"+e.selectedMonth+"-"+"01";t.post("php/MonthlyHelper.php",{data:{request:"get_monthly",year:e.selectedYear,month:e.selectedMonth,yearmonth:n}}).success(function(e,t){e.ERROR?console.log(e):console.log(e)}).error(function(e,t){console.log("Post failed.")})};e.init=function(){e.setDates();e.getMonthData()};e.init()}];